import React from "react";
import {useParams} from "react-router-dom";

interface IProps{}
interface UrlParams {
    productId : string
}

let ProductDetail : React.FC<IProps> = () => {
    let {productId} = useParams<UrlParams>();
    return(
        <React.Fragment>{productId}</React.Fragment>
    )
}

export default ProductDetail;
